import './Styles/Style.css'
import BasicTabs from './Components/Navigation';
import BasicBreadcrumbs from './Components/Nav';
import { BrowserRouter, NavLink, Route, Routes } from 'react-router-dom'

function App() {
  UsersStore.fetchUsers()
  return (
    <div className="App">
      {/* <BasicTabs /> */}
      <BrowserRouter>
      <NavLink to={'/userslist'}><UserList/></NavLink>
      <NavLink to={'/addeditUuer'}><AddEditUser/></NavLink>
      <Routes>
        <Route path={'/userslist'} element={<UserList/>}/>
        <Route path={'/addeditUer'} element={<AddEditUser/>}/>
      </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
